foreach 1.5.0 on CRAN with one important improvement:

y &lt;- foreach(...) %dopar% { expr }

now evaluates the 'expr' in a *local()* env by default. This lowers the risk for mistakes/misusages such as:

k &lt;- 0
y &lt;- foreach(...) %dopar% { 
  ...
  k &lt;- k + 1
}

